   "source": [
    "ggplot(data = Stud_Per, mapping = aes(x= Stud_Per$`math score`, y= Stud_Per$`reading score` ))+\n",
    "  geom_jitter(alpha=0.5)+geom_rug(position = \"jitter\", size=.08)+\n",
    "  geom_smooth(linewidth=0.7)+\n",
    "  stat_cor(method = \"pearson\", label.x = 100, label.y = 100)+\n",
    "  labs(title = \"math vs reading\", x=\"math score\", y=\"Reading Score\")+\n",
    "  theme_minimal()\n",
    "#A correlation coefficient of 0.82 suggests that there is a link between math score and reading score available that is reasonably strong. \n",
    "#The higher the math score the higher the reading score, despite the fact that other factors may also impact such increases.\n"
   ]
